/*
//根据保额计算保费折扣率be-保额,nian-供款年期
投保额	>=12W	>=15W	>=20W	>=30W	>=40W
折扣档次	 0        1      2        3       4
    5    0.54 	1.09 	1.63 	2.18 	2.45
   10    0.34 	0.68 	1.02 	1.35 	1.52
   15    0.26 	0.53 	0.79 	1.06 	1.19
   20    0.23 	0.47 	0.70 	0.94 	1.06
   25    0.20 	0.39 	0.59 	0.79 	0.89

*/
function Get_Dis_BF_Rate(be,nian){
    var x = 0;
//arr_Dis[年期,折扣档次]-保费折扣率
    var arr_dis = [5,10,15,20,25];
    arr_dis[5]=[0.54,1.09,1.63,2.18,2.45];
    arr_dis[10]=[0.34,0.68,1.02,1.35,1.52];
    arr_dis[15]=[0.26,0.53,0.79,1.06,1.19];
    arr_dis[20]=[0.23,0.47,0.70,0.94,1.06];
    arr_dis[25]=[0.20,0.39,0.59,0.79,0.89];

    if(be>=40){ x = arr_dis[nian][4];}
    else if(be>=30){x = arr_dis[nian][3];}
    else if(be>=20){x = arr_dis[nian][2];}
    else if(be>=15){x = arr_dis[nian][1];}
    else if(be>=12){x = arr_dis[nian][0];}
    return x;
}

/*
dis_bf(bf,be,nian)计算保费考虑折扣因素bf-保费率，be-保额,nian-供款年期
*/
function dis_bf(bf,be,nian){         //bf-保费,be-保额
    var Dis_rate,x;
    Dis_rate = Get_Dis_BF_Rate(be,nian);
    x = bf - Dis_rate
    return x*be*10 ;
}

/*
dis_be(area,sex,age,nian,smoke,bf)
知道保费预算求保额

area-保费率地区 A-0 B-1，sex-性别,男0女1,
age-年龄,nian-供款年期,smoke-非吸烟0,吸烟1
bf-保费,be-保额
*/

function dis_be(area,sex,age,nian,smoke,bf){    //
    var x=0,dis1,dis2,dis3,dis4,dis5,bfl;
    bfl = chk_bfl(area,sex,smoke,nian,age); //计算保费率
//计算折扣对应的保费
    dis1 = dis_bf(bfl,12,nian); //12W保额对应的保费
    dis2 = dis_bf(bfl,15,nian); //15W保额对应的保费
    dis3 = dis_bf(bfl,20,nian); //20W保额对应的保费
    dis4 = dis_bf(bfl,30,nian); //30W保额对应的保费
    dis5 = dis_bf(bfl,40,nian); //40W保额对应的保费

    if(bf>=dis5){ x = Get_Dis_BF_Rate(40,nian);}
    else if(bf>=dis4){x = Get_Dis_BF_Rate(30,nian);}
    else if(bf>=dis3){x = Get_Dis_BF_Rate(20,nian);}
    else if(bf>=dis2){x = Get_Dis_BF_Rate(15,nian);}
    else if(bf>=dis1){x = Get_Dis_BF_Rate(12,nian);}

    return bf/(10*(bfl-x));
}

